%[text] %[text:anchor:T_ED9CBB17] # **Rangefinder Chart Examples**
%[text] **Overview**
%[text] The `RangefinderChart` creates a visualization of bivariate scattered data together with horizontal and vertical lines representing marginal data statistics. Specifically, the chart comprises
%[text] - a 2D discrete plot containing the scattered $(x, y)$ data,
%[text] - a crosshair indicating the intersection of the marginal medians,
%[text] - vertical lines indicating the lower and upper adjacent values for the $x$ data,
%[text] - horizontal lines indicating the lower and upper adjacent values for the $y$ data. \
%[text] The lengths of the lines are given by the marginal interquartile ranges. The *adjacent values* are the nearest data points inside the range determined by the lower and upper values. The *lower and upper values* are 1.5 interquartile ranges outside of the lower and upper quartiles, respectively. 
%[text] The chart data comprises numeric vectors `XData` and `YData`.
%[text] ![RangefinderChart.png](text:image:94cb)
%[text] **Documentation**
%[text] - [`scatter`](<matlab: doc("scatter")>): Scatter plot
%[text] - [`line`](<matlab: doc("line")>): Create primitive line
%[text] - [`plot`](<matlab: doc("plot")>): 2-D line plot
%[text] - [`datatip`](<matlab: doc("datatip")>): Create data tip
%[text] - Martinez, W.L., Martinez, A.R. and Solka, J.L. 2011. \*Exploratory Data Analysis with MATLAB (Second Edition), \*Chapter 9, Section 9.5 (pp. 356-359). Boca Raton, Florida: Chapman and Hall/CRC Press, Taylor & Francis Group. \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_14C0DAE0] ## Create sample chart data.
%[text] We start by defining sample $x$ and $y$ data vectors for the chart.
numPoints = 1000;
rng( "default" )
x = 2 * randn( numPoints, 1 );
y = 2 * x + 1 + 2 * randn( numPoints, 1 );
%%
%[text] %[text:anchor:H_4B88A838] ## Create a figure for the chart.
f = exampleFigure( "Name", "RangefinderChart Example" ); %[output:986837a8]
%%
%[text] %[text:anchor:H_4DB5A6E8] ## Create the chart, specifying the parent and input data.
RFC = RangefinderChart( "Parent", f, ... %[output:group:476e9734] %[output:986837a8]
    "XData", x, ... %[output:986837a8]
    "YData", y ); %[output:group:476e9734] %[output:986837a8]
%%
%[text] %[text:anchor:H_7786F394] ## Annotate the chart.
xlabel( RFC, "x" ) %[output:693de507]
ylabel( RFC, "y" ) %[output:693de507]
title( RFC, "Rangefinder Chart" ) %[output:693de507]
%%
%[text] %[text:anchor:H_D2020602] ## Truncate the $x$-data of the chart.
RFC.XData = RFC.XData(1:round(numPoints/10)); %[output:8e4b7436]
%%
%[text] %[text:anchor:H_3C03745E] ## Reinstate the original chart data.
RFC.XData = x; %[output:48a239e3]
RFC.YData = y; %[output:48a239e3]
%%
%[text] %[text:anchor:H_BAAE9170] ## Modify the $y$ data of the chart.
RFC.YData = (-1) * RFC.YData; %[output:64f6a94c]
%%
%[text] %[text:anchor:H_B7ECE8B6] ## Translate the chart data.
RFC.XData = 5 + RFC.XData; %[output:2592ef82]
RFC.YData = -5 + RFC.YData; %[output:2592ef82]
%%
%[text] %[text:anchor:H_295EED44] ## Customize the chart appearance.
RFC.Marker = "."; %[output:864a17cb]
RFC.SizeData = 64; %[output:864a17cb]
RFC.CData = [1, 0.2, 0]; %[output:864a17cb]
%%
